import 'package:json_annotation/json_annotation.dart';part 'user_md.g.dart';@JsonSerializable(anyMap: true)class UserModel {  String userId;  String userProfileId;  String phoneNumber;  String password;  bool isAdmin;  @override  UserModel({    required this.userId,    required this.userProfileId,    required this.phoneNumber,    required this.password,    required this.isAdmin,  });  factory UserModel.fromJson(Map json) => _$UserModelFromJson(json);  Map toJson() => _$UserModelToJson(this);}